import axios from "axios";
const crypto = require("crypto");

const PUBLICKEY = "cb68fc2ec155c195822ef51f03beb395";
const PRIVATEKEY = "12ae1f4be3a7ee1916245e66d313f38211fb9302";
const BASEURL = "http://gateway.marvel.com/v1/public/comics?limit=24&apikey="+PUBLICKEY
var ts = new Date().getTime();
var hash = crypto.createHash('md5').update(ts + PRIVATEKEY + PUBLICKEY).digest('hex');
BASEURL += "&ts="+ts+"&hash="+hash;
console.log(BASEURL);

const BASEURL2 = "http://gateway.marvel.com/v1/public/comics?limit=100&format=comic&apikey="+PUBLICKEY

export default {
  search: function() {
    return axios.get(BASEURL);
  }
};
